        static string GetTwoDigitNumber(string text)
        {
            var numbers = text.Where(x => Char.IsDigit(x));
            var firstNumber = Char.GetNumericValue(numbers.First()).ToString();
            var lastNumber = Char.GetNumericValue(numbers.Last()).ToString();

            return firstNumber + lastNumber;
        }

        static int GetEncryptedTotalValue(string values)
        {
            var totalList = new List<string>();
            int total = 0;

            using (StringReader reader = new StringReader(values))
            {
                string line;
                while ((line = reader.ReadLine()) != null)
                {
                    totalList.Add(GetTwoDigitNumber(line));
                }
            }

            totalList.ForEach(x => total += Int32.Parse(x));

            return total;
        }
